import React from 'react'

function Register() {
    return (
        <>
            <div className="RegisterBody">
                <form className="RegisterBodyDiv">
                    <label htmlFor="firstName">First Name:</label><input type="text" />
                </form>
            </div>
        </>
    )
}

export default Register
